import React from 'react';
import { Typography, Box } from '@mui/material';
import { makeStyles } from '@mui/styles';
import ProfileImage from '../../assets/p1.jpg';

const useStyles = makeStyles(() => ({
    profileImage: {
        borderRadius: '50%',
        margin: '20px'
    },
    container: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    textContainer: {
        display: 'flex',
        flexDirection: 'column',
        justifyContent: 'center',
    },
}));

const Home = () => {
    const classes = useStyles();
    return (
        <Box className={classes.container}>
            <Box className={classes.textContainer}>
                <Typography variant="h3">Étudiant en Intelligence Artificielle</Typography>
                <Typography variant="p">Je suis passionné par l'intelligence artificielle et j'aimerais apporter ma contribution à ce domaine fascinant.</Typography>
            </Box>
            <Box>
                <img src={ProfileImage} alt="Profile" className={classes.profileImage} />
            </Box>
        </Box>
    );
};

export default Home;
